import Card from '../Card/Card';

 export default function Cards(props) {
  const {characters} = props;
   return (
    <div>
       {characters.map(({id, name, species, gender, image})=>(
       <Card 
       key={id}
       name={name}
       species={species}
       gender={gender}
       image={image}
       onclose={()=> window.alert("Emulamos que se cierra la card")}
       />
       ))}
    </div>
    )
 }
